import React from 'react'
import { Link } from 'react-router-dom'

export default function MainNavigation() {
    return (
        <header>
            <div>React Meetups</div>
            <nav>
                <ul>
                    <li>
                        <Link>Some Link</Link>
                    </li>
                    {/* <li></li> */}
                </ul>
            </nav>
        </header>
    )
};
